// ==UserScript==
// @name         Typeracer: Better Countdown
// @namespace    http://tampermonkey.net/
// @version      1.5
// @downloadURL  https://raw.githubusercontent.com/PoemOnTyperacer/tampermonkey/master/better_countdown.user.js
// @updateURL    https://raw.githubusercontent.com/PoemOnTyperacer/tampermonkey/master/better_countdown.user.js
// @description  Drag and drop, audio cue, and precision countdown for Typeracer
// @author       altrocality & poem
// @match        https://play.typeracer.com/*
// @match        https://staging.typeracer.com/*
// @icon         https://www.google.com/s2/favicons?domain=typeracer.com
// @grant        GM_registerMenuCommand
// @grant        GM_getValue
// @grant        GM_setValue
// @noframes
// ==/UserScript==


/*DEBUG*/
function log(msg, color='#7DF9FF') {
    if(debug) console.log('%c [Countdown Alert] '+msg, 'color: '+color);
}


/*SETTINGS*/
let debug, audio, volume, precision_countdown, show_decimals;
const DEFAULT_SETTINGS = {
    debug: false,
    audio: true,
    volume: 100,
    precision_countdown:true,
    show_decimals:false
}

let GUITimeout; // Used to animate the Settings "Save" button
const SETTINGS_PREFIX='countdownAlertSettings0'; // Prefix to all GM_setValues, to avoid conflict with other userscripts

loadSettings();
addConfig(); // Add Tampermonkey config menu

function loadSettings() {
    debug = GM_getValue(SETTINGS_PREFIX+"debug", DEFAULT_SETTINGS.debug);
    audio = GM_getValue(SETTINGS_PREFIX+"audio", DEFAULT_SETTINGS.audio);
    volume = parseInt(GM_getValue(SETTINGS_PREFIX+"volume", DEFAULT_SETTINGS.volume));
    precision_countdown = GM_getValue(SETTINGS_PREFIX+"precision_countdown", DEFAULT_SETTINGS.precision_countdown);
    show_decimals = GM_getValue(SETTINGS_PREFIX+"show_decimals", DEFAULT_SETTINGS.show_decimals);
    printSettings();
}

function addConfig() {
    if (typeof GM_registerMenuCommand !== "undefined") {
        GM_registerMenuCommand("Better Countdown Settings", openConfig);
    }
}

function openConfig() {
    // Prevent multiple instances
    if (document.getElementById('configDiv')) return;

    let div = document.createElement("div");
    div.id = 'configDiv';
    div.style = `
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: rgba(0, 0, 0, 0.8);
            color: #fff;
            z-index: 10000;
            display: flex;
            align-items: center;
            justify-content: center;
        `;
    div.innerHTML = `
            <div style="background: #222; padding: 20px; border-radius: 10px; text-align: center;">
                <h2>Better Countdown Settings</h2>
                <label>
                    Debug:
                    <input type="checkbox" id="myOption1" ${debug ? 'checked' : ''}>
                </label>
                <br><br>
                <label>
                    Audio:
                    <input type="checkbox" id="myOption2" ${audio ? 'checked' : ''}>
                </label>
                <br><br>
                <label id="volumeLabel" ${audio ? '' : 'style="opacity: 0.5; pointer-events:none!important;"'}>
                    Volume:
                    <input type="range" id="myOption3" min="0" max="100" value="${volume || 100}" style="width: 100%;">
                </label>
                <br><br>
                <label>
                    Precision countdown:
                    <input type="checkbox" id="myOption4" ${precision_countdown ? 'checked' : ''}>
                </label>
                <br><br>
                <label ${precision_countdown ? '' : 'style="opacity: 0.5; pointer-events:none!important;"'}>
                    Show decimal places:
                    <input type="checkbox" id="myOption5" ${show_decimals ? 'checked' : ''}>
                </label>
                <br><br>
                <button id="saveBtn">Save</button>
                <button id="closeBtn">Close</button>
            </div>
        `;
    document.body.appendChild(div);

    // Grey out show_decimals option when precision_countdown is off
    let precisionCountdownCheckbox=document.getElementById("myOption4");
    precisionCountdownCheckbox.onchange = togglePrecisionCountdown;
    function togglePrecisionCountdown() {
        let showDecimalsLabel=document.getElementById('myOption5').parentNode;
        if(precisionCountdownCheckbox.checked) {
            showDecimalsLabel.style.opacity='1';
            showDecimalsLabel.style.pointerEvents='';
        }
        else {
            showDecimalsLabel.style.opacity='0.5';
            showDecimalsLabel.style.pointerEvents='none';
        }
    }

    document.getElementById('myOption2').addEventListener('change', (event) => {
        const volumeLabel = document.getElementById('volumeLabel');
        if (event.target.checked) {
            volumeLabel.style.opacity='1';
            volumeLabel.style.pointerEvents='';
        }
        else {
            volumeLabel.style.opacity='0.5';
            volumeLabel.style.pointerEvents='none';
        }
    });

    document.getElementById("saveBtn").addEventListener("click", saveSettings);
    document.getElementById("closeBtn").addEventListener("click", closeConfig);
}

function saveSettings() {
    log('Reading new settings from UI');
    debug = document.getElementById("myOption1").checked;
    audio = document.getElementById("myOption2").checked;
    volume = parseInt(document.getElementById('myOption3').value);
    precision_countdown = document.getElementById("myOption4").checked;
    show_decimals = document.getElementById("myOption5").checked;
    printSettings();

    log('Storing new settings');
    GM_setValue(SETTINGS_PREFIX+"debug", debug);
    GM_setValue(SETTINGS_PREFIX+"audio", audio);
    GM_setValue(SETTINGS_PREFIX+"volume", volume);
    GM_setValue(SETTINGS_PREFIX+"precision_countdown", precision_countdown);
    GM_setValue(SETTINGS_PREFIX+"show_decimals", show_decimals);

    document.getElementById("saveBtn").innerText = "Saved!";
    clearTimeout(GUITimeout);
    GUITimeout = setTimeout(function() {
        let saveEl=document.getElementById("saveBtn");
        if(saveEl==null) return;
        saveEl.innerText = "Save";
    },1500);
}

function closeConfig() {
    let div = document.getElementById('configDiv');
    if (div) {
        div.parentNode.removeChild(div);
    }
}

function printSettings() {
    log('Settings:\ndebug = '+debug+'\naudio = '+audio+'\nvolume = '+volume+'\nprecision_countdown = '+precision_countdown+'\nshow_decimals = '+show_decimals);
}


/*CONTEXT*/
const newTheme = typeof com_typeracer_redesign_Redesign === "function";
const isFirefox = navigator.userAgent.toLowerCase().includes('firefox');
const audioCtx = new (window.AudioContext || window.webkitAudioContext)();

// Due to browser autoplay policies, AudioContext needs to be resumsed in response to a user interaction
function initAudio(event) {
    if (audioCtx.state === 'suspended' && !isModifierKey(event)) {
        log('Attempting to resume AudioContext');
        audioCtx.resume().then(() => {
            log('AudioContext state after resume: ' + audioCtx.state);
            document.removeEventListener('keydown', initAudio);
            document.removeEventListener('click', initAudio);
            document.removeEventListener('touchstart', initAudio);
            document.removeEventListener('mousedown', initAudio);
            document.removeEventListener('pointerdown', initAudio);
            removeClickBanner();
        });
    }
}

function isModifierKey(event) { // Modifier keys don't count as user input
    return ['Shift', 'Control', 'Alt', 'Meta'].includes(event.key);
}

if (audioCtx.state === 'suspended') {
    if(audio&&isFirefox) showClickBanner(); // Firefox is stricter that chromium, and doesn't count combinations like Ctrl Alt i as user input. This may lead to the sound not working for a full keyboard nav user
    document.addEventListener('keydown', initAudio);
    document.addEventListener('click', initAudio);
    document.addEventListener('touchstart', initAudio);
    document.addEventListener('mousedown', initAudio);
    document.addEventListener('pointerdown', initAudio);
}

// Warning banner for the scenario described above
function showClickBanner() {
    const banner = document.createElement('div');
    banner.id = 'click-banner';
    banner.style.position = 'fixed';
    banner.style.bottom = '0';
    banner.style.left = '0';
    banner.style.width = '100%';
    banner.style.backgroundColor = 'rgba(255, 204, 0, 0.2)';
    banner.style.color = '#000';
    banner.style.textAlign = 'center';
    banner.style.padding = '4px';
    banner.style.fontSize = '7px';
    banner.style.fontWeight = 'bold';
    banner.style.zIndex = '9999';
    banner.innerText = 'Click anywhere to allow countdown audio';
    document.body.appendChild(banner);
}

function removeClickBanner() {
    const banner = document.getElementById('click-banner');
    if (banner) {
        banner.parentNode.removeChild(banner);
    }
}


/*SOUNDS*/
const BEEP_DATA = "";
const START_BEEP_DATA = "";

let beepBuffer,startBeepBuffer;
let scheduledSounds = []; // Will contain the sources of all sounds scheduled to be played
loadSounds(); // Pre-loading sounds

function loadSounds() {
    const beepArrayBuffer = base64ToArrayBuffer(BEEP_DATA);
    const startBeepArrayBuffer = base64ToArrayBuffer(START_BEEP_DATA);

    const beepPromise = audioCtx.decodeAudioData(beepArrayBuffer)
    .then(decodedData => {
        beepBuffer = decodedData;
    })
    .catch(error => {
        console.error('Error decoding BEEP audio data', error);
    });

    const startBeepPromise = audioCtx.decodeAudioData(startBeepArrayBuffer)
    .then(decodedData => {
        startBeepBuffer = decodedData;
    })
    .catch(error => {
        console.error('Error decoding START_BEEP audio data', error);
    });

    return Promise.all([beepPromise, startBeepPromise]);
}

function base64ToArrayBuffer(base64) {
    const binaryString = atob(base64);
    const len = binaryString.length;
    const bytes = new Uint8Array(len);
    for (let i = 0; i < len; i++) {
        bytes[i] = binaryString.charCodeAt(i);
    }
    return bytes.buffer;
}

// Schedule a sound using Web Audio API
function playSoundAtTime(audioBuffer, time) {
    const source = audioCtx.createBufferSource();
    source.buffer = audioBuffer;

    // Create a GainNode to control the volume
    const gainNode = audioCtx.createGain();
    gainNode.gain.value = volume / 100; // Convert volume to a value between 0.0 and 1.0
    // Connect the nodes: source -> gain -> destination
    source.connect(gainNode).connect(audioCtx.destination);

    source.start(time);

    // Store the scheduled start time
    source.startTime = time;
    // Store the source
    scheduledSounds.push(source);
}

// Cancel all scheduled sounds
function interruptSounds() {
    let i=1;
    scheduledSounds.forEach(source => {
        const soundEndTime = source.startTime + source.buffer.duration;
        if (audioCtx.currentTime < soundEndTime) {
            log('Cancelling scheduled sound #'+(i++));
            source.stop();
        }
    });
    scheduledSounds = [];
}



/*LOGIC*/
let countingDown=0; // 0 <=> no active countdown
let precision_countdown_started=false; // Separate flag for the visual countdown, in case the sound can't be started at the same time due to a suspended AudioContext

// Observe mutations for new/removed countdown popup
// Here and in the rest of the script, we'll use performance.now() for a high resolution timestamp, that additionally isn't affected by system clock changes
function elementMutate(mutations_list) {
    mutations_list.forEach(function(mutation) {
        mutation.addedNodes.forEach(function(added_node) {
            if(added_node.className == "countdownPopup horizontalCountdownPopup") {
                let timestamp = performance.now();
                log('Countdown popup detected at timestamp = '+timestamp);
                observeCountdown(added_node);
                newDragAndDropCountdown(added_node);
            }
        });
        mutation.removedNodes.forEach(function(removed_node) {
            if (removed_node.className === "countdownPopup horizontalCountdownPopup") {
                log('Countdown popup removed');
                countdownRemoval(removed_node);
            }
        });
    });
}
const elementObserver = new MutationObserver(elementMutate);
elementObserver.observe(document.body, {subtree: false, childList: true});


// On new countdown popup, observe the text label within and create visual countdown canvas
function observeCountdown(countdown_popup) {
    let time_elements=countdown_popup.getElementsByClassName('time');
    if (time_elements.length === 0) return;
    const time_label = time_elements[0]; // Contains the vanilla countdown text

    // Creating a canvas to display the visual countdown
    // A canvas is preferred to updating the textContent for faster content updates
    let container = time_label.parentNode;
    let canvas = container.querySelector('canvas.precision_time_canvas');
    if (!canvas) {
        canvas = document.createElement('canvas');
        canvas.className = 'precision_time_canvas';
        canvas.width = 50; // in px
        canvas.height = 50;
        canvas.style.display = 'inline-block';
        canvas.style.verticalAlign = 'middle';
        canvas.style.pointerEvents = 'none';
        container.appendChild(canvas); // Adding canvas to countdown popup
        time_label.style.visibility='hidden'; // Hiding the original countdown text
        time_label.style.position='absolute'; // And removing it from the popup
    }
    // Determine what color the countdown popup background is (theme dependent)
    let target = time_label;
    while (target !== document.body && window.getComputedStyle(target).backgroundColor === 'rgba(0, 0, 0, 0)') {
        target = target.parentElement;
    }
    const bgColor = window.getComputedStyle(target).backgroundColor;
    let rgb = bgColor.match(/\d+/g).map(Number);
    log('Time label background color = '+rgb);

    // Choose a high contrast color for the canvas text
    let luminance = 0.2126 * rgb[0] + 0.7152 * rgb[1] + 0.0722 * rgb[2];
    let d = luminance > 128 ? 0 : 255;
    let contrastColor= `rgb(${d}, ${d}, ${d})`;
    log('Best contrast color = '+contrastColor);

    // Overriding the vanilla time label's textContent change function, to capture a precise time stamp of when it ticks down, without the delays introduced by a MutationObserver
    let originalTextContent = time_label.textContent;
    Object.defineProperty(time_label, 'textContent', {
        get() {
            return originalTextContent;
        },
        set(value) {
            originalTextContent = value;
            const changeTime = performance.now();
            onTextChange(value, changeTime, canvas, contrastColor);
        },
        configurable: true
    });

}

// When the vanilla timer changes, parse the value, and start custom visual and audio countdowns
function onTextChange(newValue, changeTime, canvas, contrastColor) {
    // Parse vanilla countdown value
    const match = /:0(.)/.exec(newValue);
    if (match === null) return;
    const countdownValue = parseInt(match[1], 10);
    log('Countdown value='+countdownValue);

    // countingDown is a flag that represents whether the custom countdowns are going on
    // 0 = OFF, 1 = not yet ready, 2 = ready to start, >2 = ongoing
    countingDown++;
    // Wait for the second countdown value, in case the user joined the race partway through the first, which would offset the countdown
    if(countingDown!=2) return;

    // When ready to start, begin the visual countdown
    if(precision_countdown&&!precision_countdown_started) {
        precision_countdown_started=true;
        log('Starting precision countdown');
        visualCountdown(countdownValue, changeTime, canvas, contrastColor);
    }

    if(!audio) return;

    // When ready to start, check if the AudioContext is running
    // If the Audio context hasn't been resumed yet, set countingDown to "not yet ready" and wait for next count down
    if(audioCtx.state==='suspended') {
        log("Can't schedule sounds: Audio context still suspended");
        countingDown=1;
        return;
    }

    // Ensure the sounds are loaded
    if (!startBeepBuffer || !beepBuffer) {
        console.error('Sounds not loaded yet.');
        return;
    }

    // Start audio countdown
    log('Scheduling sounds');
    audioCountdown(countdownValue, changeTime);
}

// Clear countdowns when the popup is removed
function countdownRemoval(removed_node) {
    interruptSounds();
    countingDown=0;
    precision_countdown_started=false;
}


/*AUDIO COUNTDOWN*/
function audioCountdown(value, changeTime, canvas, contrastColor) {
    const now = getAccurateContextTime(changeTime);
    let modifier = precision_countdown ? 0.5 : 0; // "precision_countdown" mode : delay all sounds by half a second
    let startDelay = value + modifier;

    // Schedule normal beeps
    for (let i = 1; i <= Math.min(value, 4) - 1; i++) {
        let delay = startDelay - i;
        log('Beep in ' + delay + ' seconds');
        playSoundAtTime(beepBuffer, now + delay);
    }

    // Schedule final beep
    log('Start beep in ' + startDelay + ' seconds');
    playSoundAtTime(startBeepBuffer, now + startDelay);
}

// Synchronize AudioContext time with our performance.now() timestamps
function getAccurateContextTime(changeTime) {
    if (typeof audioCtx.getOutputTimestamp === 'function') {
        const { contextTime, performanceTime } = audioCtx.getOutputTimestamp();
        // Calculate the context time corresponding to changeTime
        return contextTime + (changeTime - performanceTime) / 1000;
    } else {
        // Fallback method if getOutputTimestamp is not supported
        log('getOutputTimestamp not supported: using fallback method to synchronize audio');
        const now = audioCtx.currentTime;
        const perfNow = performance.now();
        return now + (changeTime - perfNow) / 1000;
    }
}


/*VISUAL COUNTDOWN*/
function visualCountdown(value, changeTime, canvas, contrastColor) {

    const durationInSeconds = value - 1;
    let startTime = changeTime + 1500;
    if (!show_decimals) startTime += 1000;
    const endTime = startTime + durationInSeconds * 1000;

    const ctx = canvas.getContext('2d');

    // Handle high-DPI displays for sharper text
    const scale = window.devicePixelRatio || 1;
    canvas.width = 50 * scale;
    canvas.height = 50 * scale;
    canvas.style.width = '50px'; // CSS width
    canvas.style.height = '50px'; // CSS height
    ctx.scale(scale, scale);

    // Text properties
    ctx.font = '34px Lato, sans-serif';
    ctx.textAlign = 'center';
    ctx.textBaseline = 'middle';
    ctx.fillStyle = contrastColor;

    // Initial clear
    ctx.clearRect(0, 0, canvas.width, canvas.height);

    function displayTime(milliseconds) {
        const totalSeconds = milliseconds / 1000;

        const hours = Math.floor((totalSeconds / 3600) % 24);
        const minutes = Math.floor((totalSeconds / 60) % 60);
        const seconds = Math.floor(totalSeconds % 60);
        const tenths = Math.floor((milliseconds % 1000) / 100);

        // Format time
        let timeString = `${seconds}`;
        if (show_decimals) timeString = `${seconds}.${tenths}`;

        // Clear the canvas before drawing
        ctx.clearRect(0, 0, canvas.width, canvas.height);

        // Draw the countdown text
        ctx.fillText(timeString, canvas.width / (2 * scale), canvas.height / (2 * scale));
    }

    // Use a requestAnimationFrame loop to schedule the start and animation of the visual countdown
    // This allows the countdown to update with the screen's refresh rate, for smoother and more accurate updates compared to setInterval or setTimeout
    function updateCountdown() {
        const now = performance.now();
        if (now < startTime) { // Countdown hasn't started yet; continue the loop
            requestAnimationFrame(updateCountdown);
        }
        else { // Countdown is active
            const remainingTime = endTime - now;
            if (remainingTime <= 0) {
                displayTime(0);
            }
            else {
                displayTime(remainingTime);
                requestAnimationFrame(updateCountdown);
            }
        }
    }
    requestAnimationFrame(updateCountdown);
}



/*DRAG AND DROP COUNTDOWN*/
// Configure new countdown popup
function newDragAndDropCountdown(popupElement) {
    restoreFormat(popupElement);
    dragElement(popupElement);
    popupElement.style.cursor='move';
}

// Allow drag and drop on the countdown popup element
function dragElement(element)
{
    let pos1 = 0, pos2 = 0, pos3 = 0, pos4 = 0;
    if (document.getElementById(element.id + "header")) document.getElementById(element.id + "header").onpointerdown = dragMouseDown;
    else element.onpointerdown = dragMouseDown;

    function dragMouseDown(e) {
        e = e || window.event;
        e.preventDefault();
        pos3 = e.clientX;
        pos4 = e.clientY;
        document.onpointerup = closeDragElement;
        document.onpointermove = elementDrag;
    }

    function elementDrag(e) {
        e = e || window.event;
        e.preventDefault();
        pos1 = pos3 - e.clientX;
        pos2 = pos4 - e.clientY;
        pos3 = e.clientX;
        pos4 = e.clientY;
        element.style.top = (element.offsetTop - pos2) + "px";
        element.style.left = (element.offsetLeft - pos1) + "px";
    }

    function closeDragElement() {
        document.onpointerup = null;
        document.onpointermove = null;
        storeFormat(element);
    }
}

// Read and write the latest countdown position to local storage + reposition the popup
function storeFormat(element) {
    let top = element.style.top;
    let left = element.style.left;
    log('Storing popup position: top='+top+', left='+left);
    GM_setValue(SETTINGS_PREFIX+"popup_position", [top,left].join(','));
}

function restoreFormat(element) {
    let data = GM_getValue(SETTINGS_PREFIX+"popup_position");
    if(data===undefined) {
        data= [element.style.top,element.style.left].join(',');
        log('No popup position data found. Storing current position');
        storeFormat(element);
        return;
    }
    data=data.split(',');
    element.style.top = data[0];
    element.style.left = data[1];
    log('Restoring popup position: top='+data[0]+', left='+data[1]);
}
